//customAlert.js

function  sConfirm(content,sure,cancel,event, url){	
	var webAppUrl = "";
	var i18N = {
			"en":{
				"content": "Thank you for contacting us, we will get back to you ASAP！",
				"okay": "ok",
				"cancel": "cancel"
			},
			"zh":{
				"content": "\u8c22\u8c22\u60a8\u4e0e\u6211\u4eec\u8054\u7cfb\uff0c\u6211\u4eec\u4f1a\u5c3d\u5feb\u56de\u590d\u60a8\u7684\uff01",//谢谢您与我们联系，我们会尽快回复您的！
				"okay": "\u786e\u5b9a",//确定
				"cancel": "\u53d6\u6d88"//取消
			},
			"ja":{
				"content": "Thank you for contacting us, we will get back to you ASAP！",//谢谢您与我们联系，我们会尽快回复您的！
				"okay": "\u6C7A\u5B9A\u3059\u308B",//确定
				"cancel": "\u53d6\u6d88"//取消
			},
			"zh_TW":{
				"content": "Thank you for contacting us, we will get back to you ASAP！",//谢谢您与我们联系，我们会尽快回复您的！
				"okay": "\u78BA\u5B9A",//确定
				"cancel": "\u53d6\u6d88"//取消
			},
			"ko":{
				"content": "Thank you for contacting us, we will get back to you ASAP！",//谢谢您与我们联系，我们会尽快回复您的！
				"okay": "\uACB0\uC815",//确定
				"cancel": "\uCDE8\uC18C"//取消
			}
		};
    //语言判断，如果没有全局live800_Language；则取浏览器的language
	live800_Language = typeof live800_Language != "undefined" ? live800_Language : ((window.navigator.language || window.navigator.browserLanguage).indexOf("zh")>=0? "zh" : (window.navigator.language || window.navigator.browserLanguage));
	if((typeof live800_baseUrl!= "undefined")&&(typeof live800_baseWebApp!= "undefined")){
		var proto = 'https:' == document.location.protocol ? 'https://': 'http://';
		webAppUrl = proto + live800_baseUrl + live800_baseWebApp + "/chatClient/";
	}
	if(document.body==null){
		return;
	}	
    //默认中文
	if(content==null){
		 content = i18N[live800_Language]["content"];
	}
	if(sure==null){
		sure = i18N[live800_Language]["okay"];//确定
	}
	if(cancel==null){
		cancel = i18N[live800_Language]["cancel"];//取消
	}

	 var sWidth,sHeight;
	 sWidth=window.screen.width;
	 sHeight=getbodyHeight();//这里需要使用网页全文正文的高
	 
	 var msgw,msgh,bordercolor,titleheight,bordercolor,fontcolor,inputbgcolor,fontsize,msgDivHeight;
	 msgw=400;//提示窗口的宽度
	 msgh=163;//提示窗口的高度
	 titleheight=25; //提示窗口标题高度
	 bordercolor="#EBEBEB";//提示窗口的边框颜色
	 fontcolor="#434343";//
	 inputbgcolor="#15A3DB";
	 fontsize="14px";
	 msgDivHeight="60px";
	 var bgObj=document.createElement("div");
	 bgObj.setAttribute('id','live800_bgDiv');
	 bgObj.style.position="absolute";
	 bgObj.style.top="0";
	 bgObj.style.background="#777";
	 bgObj.style.filter="progid:DXImageTransform.Microsoft.Alpha(Opacity=50)";
	 bgObj.style.opacity="0.6";
	 bgObj.style.left="0";
	 bgObj.style.width=sWidth + "px";
	 bgObj.style.height=sHeight + "px";
	 bgObj.style.zIndex = "2147480001";	
	 document.body.appendChild(bgObj);	
	 
	 var msgObj=document.createElement("div")
	 msgObj.setAttribute("id","live800_msgDiv");
	 msgObj.setAttribute("align","center");
	 msgObj.style.background="white";
	 msgObj.style.border="1px solid " + bordercolor;
	 msgObj.style.position = "fixed";
	 //IE6 position 
	 if(!-[1,] && !window.XMLHttpRequest) msgObj.style.position = "absolute";
	 msgObj.style.left = "50%";
	 msgObj.style.top = "50%";
	 msgObj.style.marginLeft = "-225px" ;
	 msgObj.style.marginTop = -75+"px";
	 msgObj.style.width = msgw + "px";
	 msgObj.style.height = msgh + "px";
	 msgObj.style.textAlign = "center";
	 msgObj.style.lineHeight ="25px";
	 msgObj.style.zIndex = "2147480002";
	 msgObj.style.fontFamily = "microsoft yahei";
	 msgObj.style.border = "1px solid "+bordercolor;
	 msgObj.innerHTML = "<div style='width:100%;border-bottom:1px solid "+bordercolor+";height:45px;line-height:45px;text-align:right;'><img style='margin-top:14px;display:inline;margin-left:22px;float:left;' src='"+webAppUrl+"version5/h/images/logo.png'>"+
	 "<img id='closeImg' src='"+webAppUrl+"version5/h/images/close1.png' style='margin-top:12px;display:inline;margin-right:22px;cursor:pointer;' onmouseover=\"this.src='"+webAppUrl+"version5/h/images/close2.png';\" onmouseout=\"this.src='"+webAppUrl+"version5/h/images/close1.png';\"></div>"+
	 "<div style='width:100%;height:"+msgDivHeight+";line-height:"+msgDivHeight+";font-size:"+fontsize+";'><span style='margin-left:22px;color:"+fontcolor+";'>"+content+"</span></div>"+
	 "<div style='width:100%;height:55px;text-align:right;'>"+
	 "<input id='sure' type='button' value='"+sure+"' style='background-color:"+inputbgcolor+";font-size:"+fontsize+";color:white;width:95px;height:35px;margin-right:22px;border-radius:4px;border:1px solid;cursor:pointer;font-family:微软雅黑;'/>"+
	 "<input id='cancel' type='button' value='"+cancel+"'  style='background-color:white;font-size:14px;width:95px;height:35px;margin-right:22px;border-radius:4px;border:1px solid #EBEBEB;cursor:pointer;font-family:微软雅黑;'/></div>";
	 document.body.appendChild(msgObj);	
	 //点击弹出看的 X也可以关闭
	 document.getElementById("sure").onclick=function(){
		 document.body.removeChild(bgObj);
		 document.body.removeChild(msgObj);
		 //执行传递过来的函数体
		event();
	 }
	 document.getElementById("cancel").onclick=function(){
		document.body.removeChild(bgObj);
		document.body.removeChild(msgObj);
	 }
	 document.getElementById("closeImg").onclick=function(){
		document.body.removeChild(bgObj);
		document.body.removeChild(msgObj);
	}
}

function getClassName(obj,sName)      //-->obj是要获取元素的父级
{                                     //-->sName是class名字
	if(document.getElementsByClassName){
		return obj.getElementsByClassName(sName);
	}else{		
		var aTmp = obj.getElementsByTagName('div');
		var aRes=[];
		var arr =[];

		for(var i=0;i<aTmp.length;i++)
		{	
			arr = aTmp[i].className.split(' ');
			for (var j=0;j<arr.length;j++)
			{
				if(arr[j] == sName)
				{
					aRes.push(aTmp[i]);
				}
			}
		}
		return aRes;
	}
}
function getbodyHeight(){
    var D = document;
    return Math.max(Math.max(D.body.scrollHeight,D.documentElement.scrollHeight), Math.max(D.body.offsetHeight, D.documentElement.offsetHeight), Math.max(D.body.clientHeight, D.documentElement.clientHeight));
};

